import { Component } from '@angular/core';

@Component({
  selector: 'app-national-day-slider',
  templateUrl: './national-day-slider.component.html',
  styleUrls: ['./national-day-slider.component.css']
})
export class NationalDaySliderComponent {

}
<section class="slider">
    <div class="layer">
        <img src="../../../../assets/images/layer.png" alt="">
    </div>
    <div class="container">
        <img src="../../../../assets/images/national-day-img.png" alt="" class="w-100">
    </div>
</section>
